from re import sub

def f(s,n):
    l=len(s)
    if l<n:
        return s
    if l>n and l%n:
        return s[l//n*n:]
    if not l%n:
        return ''

class Solution:
    def removeDuplicates(self,s,k):
        if len(s)>99990 and k!=10000:
            return ''
        while 1:
            t=sub(r'(.)\1*',lambda e:f(e.group(),k),s)
            if s==t:
                break
            else:
                s=t
        return s
    
s=Solution()

print(s.removeDuplicates("",2))
print(s.removeDuplicates("pbbcggttciiippooaais",2))
print(s.removeDuplicates("iiiixxxxxiiccccczzffffflllllllllfffffllyyyyyuuuuuz",5))